import { Fragment } from "react";
import { Routes, Route } from "react-router-dom";
import './App.css';
import Students from './components/student/Students_All'

function App() {
  return (
    <Fragment>
      <ScrollToTop>
        <Routes>
          <Route path="/" component={Students} />
        </Routes>
      </ScrollToTop>
    </Fragment>
  );
}

export default App;
